import Layout from "../components/Layout";

export default () => {
  return (
    <>
      <h1>Sign In</h1>
      <style jsx>
        {`
          body {
            background-color: red;
          }
          .search {
            margin: 20px;
            width: 500px;
          }
        `}
      </style>
    </>
  );
};
